	viewMgr.visBBoxBottom = 1.494948;
	viewMgr.visBBoxTop = 8.031248;
	viewMgr.highlightDiv = null;
}

function load ()
{
	if(isUpLevel)
	{
		arrowdiv.innerHTML = '<img id="arrowgif" alt="Shows the location of the selected shape" src="warehouse_layout_arrow.gif"/>';

		var pageIndex = parent.PageIndexFromID (pageID);

	}
}

function unload()
{
	if(isUpLevel)
	{
		viewMgr = null;
		parent.viewMgr = null;
	}
}

window.onload = load;
window.onunload = unload;
document.onclick = clickMenu;
